
const puppeteer = require('puppeteer');
const express = require('express');
const fs = require('fs-extra');
const ejs = require('ejs');
const app = express();
const port = 5000;

app.get('/generate-pdf', async (req, res) => {
    try {

        generatePDF("deepak", "deep@gmail.com");

        res.status(200).send('PDF generation initiated');
    } catch (error) {
        console.error('Error initiating PDF generation:', error);
        res.status(500).send('Error initiating PDF generation');
    }
});

app.get('/pdfDownload', async (req, res) => {
    try {

        let imgArray = []
        for (let i = 0; i < 1; i++) {
            imgArray.push("data:image/png;base64,")
        }

        let name = "deepak", email = "deep@gmail.com"
        const browser = await puppeteer.launch();
        const page = await browser.newPage();

        const templatePath = './template.ejs';
        let maxPDFSize = 100;
        const templateContent = await fs.readFile(templatePath, 'utf-8');

        let pdfBuffer
        for (let i = 0; i < imgArray.length; i += maxPDFSize) {
            let renderedHtml = ejs.render(templateContent, { name: name + "" + i, email, imgArray: imgArray.slice(i, i + maxPDFSize) });

            await page.setContent(renderedHtml);

            pdfBuffer = await page.pdf({ format: 'A4' });
        }
        await browser.close();

        res.setHeader('Content-Type', 'application/pdf');
        res.setHeader('Content-Disposition', 'attachment; filename="sample.pdf"');
        res.send(pdfBuffer);
    } catch (error) {
        console.error('Error initiating PDF generation:', error);
        res.status(500).send('Error initiating PDF generation');
    }
});

